import React, { useEffect } from 'react'
import BreadCrumb from '../../../components/breadcrumbs/breadCrumb'
import EnterButtons from '../../../components/enterButtons/EnterButtons'

function CJSLanding() {
  const gridItems = [
    { id: 1, color: 'bg-blue-500' },
    { id: 2, color: 'bg-yellow-500' },
    { id: 3, color: 'bg-blue-500' },
    { id: 4, color: 'bg-yellow-500' },
  ];

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
      <div className="w-full">
        <BreadCrumb />
      </div>

      <div className="flex-grow flex flex-col items-center justify-center gap-4">
        <div className="grid grid-cols-4 gap-6">
          {gridItems.map((item) => (
            <div key={item.id} className={`w-20 h-20 ${item.color} rounded-lg`}></div>
          ))}
        </div>
        <div className="mt-8">
          <EnterButtons />
        </div>
      </div>
    </div>
  )
}

export default CJSLanding;
